public class RegisterDeliveryPersonExample : IExamplesProvider<RegisterDeliveryPersonRequest>
{
    public RegisterDeliveryPersonRequest GetExamples()
    {
        return new RegisterDeliveryPersonRequest
        {
            Identificador = Guid.NewGuid().ToString(),
            Nome = GenerateRandomName(),
            Cnpj = GenerateRandomCnpj(),
            DataNascimento = GenerateRandomBirthDate(),
            NumeroCnh = GenerateRandomCnhNumber(),
            TipoCnh = GenerateRandomCnhType(),
            ImagemCnh = GenerateBase64ImageExample() // Exemplo simulado de string base64
        };
    }

    private string GenerateRandomName()
    {
        var firstNames = new[] { "João", "Maria", "Carlos", "Ana", "Pedro", "Mariana" };
        var lastNames = new[] { "Silva", "Oliveira", "Santos", "Souza", "Pereira" };

        var random = new Random();
        var firstName = firstNames[random.Next(firstNames.Length)];
        var lastName = lastNames[random.Next(lastNames.Length)];

        return $"{firstName} {lastName}";
    }

    private string GenerateRandomCnpj()
    {
        var random = new Random();
        return $"{random.Next(10, 99)}{random.Next(100, 999)}{random.Next(100, 999)}0001{random.Next(10, 99)}";
    }

    private DateTime GenerateRandomBirthDate()
    {
        var random = new Random();
        int year = random.Next(1970, 2000); // Gera uma data de nascimento entre 1970 e 2000
        int month = random.Next(1, 13);
        int day = random.Next(1, 28); // Para evitar problemas com fevereiro
        return new DateTime(year, month, day);
    }

    private string GenerateRandomCnhNumber()
    {
        var random = new Random();
        return $"{random.Next(100000000, 999999999)}"; // Gera uma CNH com 11 dígitos
    }

    private CnhType GenerateRandomCnhType()
    {
        var random = new Random();
        var cnhTypes = Enum.GetValues(typeof(CnhType)); // Pega os valores do enumerador
#pragma warning disable CS8605 // Executando a conversão unboxing de um valor possivelmente nulo.
        return (CnhType)cnhTypes.GetValue(random.Next(cnhTypes.Length));
#pragma warning restore CS8605 // Executando a conversão unboxing de um valor possivelmente nulo.
    }

    private string GenerateBase64ImageExample()
    {
        return "";
    }
}


